class PlayerCamera extends GameObject
{
	constructor()
	{
		super();
		this.name = "PlayerCamera";
		this.collisionRadius = .7;
		this.shootTimer = 0;
        this.health = 5;
		this.isTrigger = true;
        
		//this.buffer=gl.createBuffer();
		//gl.bindBuffer(gl.ARRAY_BUFFER, this.buffer);
		//gl.bufferData(gl.ARRAY_BUFFER, new Float32Array(this.vertices), gl.STATIC_DRAW);
	}
	Update()
	{
		var horizontal = 0;
		var vertical = 0;
		var up = 0;
		var moving = false;
		if ("A" in m.keys && m.keys["A"])
		{
			this.rot[1] -= .05;
			moving = true;
		}
		if ("D" in m.keys && m.keys["D"])
		{
			this.rot[1] += .05;
			moving = true;
		}
		if ("W" in m.keys && m.keys["W"])
		{
			vertical += .25 * Math.sin(-this.rot[1] + Math.PI/2);
			horizontal += .25 * Math.cos(-this.rot[1] + Math.PI/2);
			moving = true;
		}
		if ("S" in m.keys && m.keys["S"])
        {
			vertical -= .25 * Math.sin(-this.rot[1] + Math.PI/2);
			horizontal -= .25 * Math.cos(-this.rot[1] + Math.PI/2);
			moving = true;
		}
        if ("Q" in m.keys && m.keys["Q"]) // strafe left
        {
            vertical -= .25 * Math.sin(-this.rot[1]);
			horizontal -= .25 * Math.cos(-this.rot[1]);
			moving = true;
        }
        if ("E" in m.keys && m.keys["E"]) // strafe right
        {
            vertical += .25 * Math.sin(-this.rot[1]);
			horizontal += .25 * Math.cos(-this.rot[1]);
			moving = true;
        }
       /* if ("Z" in m.keys && m.keys["Z"])
        {
            up += .25;
			moving = true;
        }
        if ("X" in m.keys && m.keys["X"])
        {
            up -= .25;
			moving = true;
        }
		*/
		// move the object
		this.velocity[0] = horizontal;
		this.velocity[1] = up;
		this.velocity[2] = vertical;
		
		//this.velocity[2] = forward;
		if (moving)
			this.Move();
		if (" " in m.keys && m.keys[" "] && this.shootTimer <= 0)
		{
			m.CreateObject(2, Bullet, [this.loc[0], this.loc[1] - 1, this.loc[2]], [this.rot[0], this.rot[1], this.rot[2]]);
			this.shootTimer = 30;
		}
		if (this.shootTimer > 0)
			this.shootTimer--;
	}
	Trigger(id)
    {
        if (id in m.solid && m.solid[id] instanceof Enemy)
            m.ResetGame();
        else if (id in m.trigger && m.trigger[id] instanceof EnemyBullet)
        {
            this.health--;
            if (this.health == 0)
                m.ResetGame();
        }            
    }
	Render(program)
	{
		// update viewing
		
		var viewTranslateLoc = gl.getUniformLocation(program, "viewTranslate");
		var viewRotateLoc = gl.getUniformLocation(program, "viewRotate");
		
		gl.uniform3fv(viewTranslateLoc, new Float32Array(this.loc));
		gl.uniform3fv(viewRotateLoc, new Float32Array(this.rot));
	
	}
}
class Enemy extends GameObject
{
    
    constructor()
    {
        super();
        this.isBillboard = 1;
        this.isColorSwapped = 1;
        this.isTrigger = true;
        this.health = 3;
        this.collisionRadius = 1;
        this.vertices = 
        [-2, -2, 0,  0, 1,
         -2, 2, 0,   0, 0,
         2, -2, 0,   1, 1,
         2, 2, 0,    1, 0
        ];
        this.indices = 
        [
        3, 1, 0,
        0, 2, 3
        ];
        
        gl.bindTexture(gl.TEXTURE_2D, this.texture);
         
         gl.texImage2D(gl.TEXTURE_2D,0,gl.RGBA,this.texWidth, this.texHeight,0,gl.RGBA,
            gl.UNSIGNED_BYTE,new Uint8Array(this.tex));
        	 
		 gl.bindBuffer(gl.ARRAY_BUFFER, this.vertexBuffer);
		 gl.bufferData(gl.ARRAY_BUFFER, new Float32Array(this.vertices), gl.STATIC_DRAW);
		 
		 gl.bindBuffer(gl.ELEMENT_ARRAY_BUFFER, this.indexBuffer);
		 gl.bufferData(gl.ELEMENT_ARRAY_BUFFER, new Uint8Array(this.indices), gl.STATIC_DRAW);
    }
    Trigger(id)
    {
        console.error("Trigger for " + this.id + " not implemented!");
    }
}
