class Bullet extends GameObject
{
	constructor()
	{
		super();
		this.name = "Bullet";
		this.collisionRadius = 0.25;
		this.buffer=gl.createBuffer();
		this.isTrigger = true;
        this.moveSpeed = 0.75;
		// vertex attribute
		this.vertices = 
		[   -.25, -.25, -.25,	    0, 0,// left face
			-.25, -.25, .25,		0, 1,
			-.25, .25, -.25,		1, 0,
			-.25, .25, .25,		1, 1,
			.25, -.25, -.25,		0, 0,// right face
			.25, -.25, .25,		0, 1,
			.25, .25, -.25,		1, 0,
			.25, .25, .25,		1, 1,
            -.25, -.25, -.25,     0, 0,// bottom face
            -.25, -.25, .25,      0, 1,
            .25,  -.25, -.25,     1, 0,
            .25,  -.25, .25,      1, 1, 
            -.25, .25, -.25,      0, 0,// top face
            -.25, .25,  .25,      0, 1,
            .25,  .25, -.25,      1, 0,
            .25,  .25,  .25,      1, 1,
            -.25, -.25, -.25,      0, 0,// back face
            -.25, .25,  -.25,     0, 1,
            .25, -.25,  -.25,     1, 0,
            .25, .25,  -.25,      1, 1,
            -.25,-.25,  .25,      0, 0,// front face
            -.25, .25,  .25,      0, 1,
            .25, -.25,  .25,      1, 0,
            .25,  .25,  .25,      1, 1
		];
		this.indices = 
		[3, 1, 0, // left face
		 0, 2, 3,
		 4, 5, 7, // right face
         7, 6, 4,
         8, 9, 11, // botom face
         11, 10, 8,
         15, 13, 12, // top face
         12, 14, 15,
         19, 17, 16, // back face
         16, 18, 19,
         20, 21, 23, // front face
         23, 22, 20
         ];
         
		this.vertexBuffer = gl.createBuffer();
		this.indexBuffer = gl.createBuffer();
        
        this.texWidth = 1;
        this.texHeight = 1;
        this.tex = [0, 255, 0, 255];
        
        
        gl.bindTexture(gl.TEXTURE_2D, this.texture);
        gl.texImage2D(gl.TEXTURE_2D,0,gl.RGBA,this.texWidth,this.texHeight,0,gl.RGBA,
            gl.UNSIGNED_BYTE,new Uint8Array(this.tex));
            
		gl.bindBuffer(gl.ARRAY_BUFFER, this.vertexBuffer);
		gl.bufferData(gl.ARRAY_BUFFER, new Float32Array(this.vertices), gl.STATIC_DRAW);
		
		gl.bindBuffer(gl.ELEMENT_ARRAY_BUFFER, this.indexBuffer);
		gl.bufferData(gl.ELEMENT_ARRAY_BUFFER, new Uint8Array(this.indices), gl.STATIC_DRAW);
		console.log("Bullet created!");
	}
	Update()
	{
		if (Math.abs(this.loc[0]) > 100 || Math.abs(this.loc[2] > 100))
		{
			m.DestroyObject(this.id);
			console.log("Bullet destroyed!");
		}
		this.velocity = [this.moveSpeed * Math.cos(-this.rot[1] + Math.PI / 2),
            0, this.moveSpeed * Math.sin(-this.rot[1] + Math.PI / 2)];
		this.angVelocity = [0, 0, 0];
		this.Move();
	}

	Trigger(id)
	{
		if (id in m.solid)
		{
            if (m.solid[id] instanceof Enemy)
            {
                m.solid[id].health--;
                if (m.solid[id].health <= 0)
                    m.DestroyObject(id);                
            }
            m.DestroyObject(this.id);
            console.log("Bullet destroyed");
		}
	}
}
class EnemyBullet extends Bullet
{
    constructor()
    {
        super();
        this.moveSpeed = .35;
        this.texWidth = 1;
        this.texHeight = 1;
        this.tex = [255, 0, 0, 255];
                
        gl.bindTexture(gl.TEXTURE_2D, this.texture);
        gl.texImage2D(gl.TEXTURE_2D,0,gl.RGBA,this.texWidth,this.texHeight,0,gl.RGBA,
            gl.UNSIGNED_BYTE,new Uint8Array(this.tex));
            
        
    }
    Trigger(id)
    {
        if (id in m.solid && !(m.solid[id] instanceof Enemy))
		{
            if (m.solid[id] instanceof PlayerCamera)
            {
                m.solid[id].health--;
                if (m.solid[id].health <= 0)
                    m.ResetGame();           
            }
            m.DestroyObject(this.id);
            console.log("Bullet destroyed");
		}   
    }
}